package main

func main() {
	s1 := ""
	s2 := ""
	println(checkInclusion(s1, s2))
}

func checkInclusion(s1 string, s2 string) bool {
	l1, l2 := len(s1), len(s2)
	if l1 > l2 {
		return false
	}
	patternFreq := make([]int, 26)
	for i := 0; i < l1; i++ {
		patternFreq[s1[i]-'a']++
	}
	patternCount := 0
	for i := 0; i < 26; i++ {
		if patternFreq[i] > 0 {
			patternCount++
		}
	}

	windowFreq := make([]int, 26)
	windowCount := 0

	left, right := 0, 0
	for right < l2 {
		r := s2[right] - 'a'
		if patternFreq[r] > 0 {
			windowFreq[r]++
			if windowFreq[r] == patternFreq[r] {
				windowCount++
			}
		}
		right++
		for windowCount == patternCount {
			if right-left == l1 {
				return true
			}
			l := s2[left] - 'a'
			if patternFreq[l] > 0 {
				windowFreq[l]--
				if windowFreq[l] < patternFreq[l] {
					windowCount--
				}
			}
			left++
		}
	}
	return false
}
